            "text" : "Apologies for the delay in getting back to you. Is there a way we can briefly talk on the phone? tl;dr: we believe that Microsoft Security Essentials has falsely detected our legitimate diskcryptor encrypted disks as Ransom:DOS/Tibbar.A, a Bad Rabbit alias. If this is the case, *we do not have Bad Rabbit*. I am working from home today on 01434 240619.",
