            "urls" : [ ],
            "text" : "Hi Tom. That’s fine, I understand and probably shouldn’t have asked! I’m pleased all is well now. I’ll miss your help and miss seeing you in the kitchen as well.  I’ll still see you on here though.\nI wish you all the very best for the future and hope it’s the beginning of a new era for you. Jean",
