            "reactions" : [ ],
            "urls" : [ ],
            "text" : "Hi Jean. Lovely to speak to you last week, and so sorry that I was not free to give you a straight answer to a straight question. But all is well now. Thanks so much for giving me a bit of a boost here on Twitter when things first started going south - the world of job-seeking is very different to when I joined NNPA 16 years ago. Anyway, I'm sorry to go, but it's time to move on. All the best to you for the future. Tom",
