            "urls" : [ ],
            "text" : "Thanks very much for the detailed reply. I was a bit bewildered by the Bricklink catalogue - I presume one has to focus in on a single seller in order to minimize postage costs. The good thing for a beginner like me on eBay is that it limits what I can buy. Since I don't have concrete plans on what to build, gong to Bricklink is rather paralysing. That seller says she will combine postage, but what it will come out at is not quite clear.",
