            "recipientId" : "14508781",
            "reactions" : [ ],
            "urls" : [ ],
            "text" : "Embleton gives you the coast, and gives you Dunstanburgh Castle. The walk from Craster to Dunstanburgh is absolutely terrific. Craster is nice, and holds one of me last happy memories befoer going veggie some years back - amazing kipper paté in the pub.",
