            "text" : "Thanks so much again Tom :) I really appreciate it! And the community is pretty wonderful :)\n\nI understand - I think. My day job is web developer so I get the screen/ratio etc stuff. Not much js in my repertoire though, so slowly working out a starting point, eg set initial zoom level &amp; bounds (Eg iframe eventually) was my plan, they only need the part where the buoys are. Want to make it nice for first open. I'll keep playing :)",
