            "urls" : [ ],
            "text" : "Re: extent and zoom, bear in mind that this can only be an approximation if you choose the full-screen template (as you have). This is because you have no control over what size (specifically what aspect ratio) the viewer's browser has. Extreme example - if you try to set a landscape extent, what does the viewer see on their phone held in portrait orientation?",
