            "text" : "Thanks! I kept reading over the weekend - my question was even more basic, answer being I think, qgis2web uses GeoJSON, tippecanoe makes vector tiles. (By serverless I just meant no map/geo server, and I thought leaflet could manage manipulating the vector tiles for tiny tiny map, maybe).",
