            "text" : "Hi Tom, thanks so much for your help with this. A friend who's good with js helped find a non omnivore solution using the csv2geojson js. I'll hopefully get time to write this up using the standard airpots dataset as tutorial over the next couple of weeks so people can combine your excellent QGIS2WEB with a live data source to hack together an updating map",
