            "urls" : [ ],
            "text" : "That is very kind of you, i've sent a link to the repo. What i hoped to do was adjust the code in the JS files QGIS2WEB data folder with the omnivore function, i think this returns as json object. The alternate would be tabletop which does much the same thing. I've got my own notes in the readme which i've used to keep track of various tutorials and repos",
