            "urls" : [ ],
            "text" : "Lots of things to juggle there - my strong suggestion is to try to simplify the number of moving parts - eg focus on omnivore without CORS and Google Sheets to see where the problem lies. If you can upload your code somewhere, I'm happy to take a look without charge.",
