            "reactions" : [ ],
            "urls" : [ ],
            "text" : "Thanks for getting back so quick and many thanks for all your hardwork on QGIS2WEB it's a great plugin. As you've helped with on SO the work is a getting omnivore to connect to a leaflet map made from QGIS, I've built the map with QGIS but as a non dev am banging my head against a wall with getting omnivore to work in place of the static data. 1st part would be a review to see what I've done wrong. I'd like to learn so if it's simple enough to fix then that might be it, if not it would be getting it work and overcoming the CORS hurdle that comes with omnivore. The source data is googlesheet output so i'm open to using tabletop if thats neater, its a sharp learning curve!",
