            "text" : "We'll need to have some idea of how they intend to spend the money though. I'd like to think Astun and the like would sponsor direct annually. Mike (Saunt) thinks that as they sponsor FOSS4G (some of which feeds through to osgeouk coffers) and other events that should be enough.",
