            "text" : "Apologies. I misread the Sam Knows results. Yes, fibre-enabled. I think everything the have said is legit, other than that if fibre we available, you'd not need a new contract, but because it's not, you need a new contract. About that, I don't know. Will have to Google it more tomorrow. https://t.co/kdFhYnFma8 forums perhaps worth asking. Do other providers allow upgrade to fibre mid contact without new contract term?",
