            "recipientId" : "296260201",
            "reactions" : [ ],
            "urls" : [ ],
            "text" : "So.... one of the problems I have with \"life coaches\" is that they are often put in a position of conflict of interest where the best advice they can give is to fire the life coach. \n\nIn this situation Mays advisers have given her awful advice because they want to continue to be the two most powerful people in Britain for as long as possible despite the damage this is going to do her. She looks weird and stupid. Bouyed only by people's sense of daze. \n\nDan hodges says she has months rather than weeks. So my guess is day's or hours.",
            "mediaUrls" : [ ],
