            "text" : "Two - same as thatcher. It's just wrong that a party can change leader and ideology and people not get a say. We live in this fantasy that we elect people who choose a party which elects a leader. Just not true. Our politics actually more presidential than US due to unchecked almost total power of leader of winning party. Change the leader... Fine. But people have to ratify that change.",
