            "urls" : [ ],
            "text" : "Yeah. Hushing these things up is all to common in industry too, but standards of expected behaviour are at least easier to police when everyone's an employee and can be referred to HR. In Oxbridge it's not just patriarchy but the fact college fellows aren't really accountable to anyone or subject to independent sanction.",
