            "text" : "Hi Tom. I just wanted to follow up on our chat. I had a long chat with Gavin (my partner) looking at how we could include you in our team. The short sad, version is that we aren't in a position to do this right now because the main  impediment in our company at the moment is the need for more 'hard code' developers. I think your skills would be really useful at some point as a bridge between developers, customers and a desire to make awesome looking products, but it just isn the right moment for us :-( I wish you all the best finding a new job, if I can do anything to help with that, feel free to let me know!",
