            "reactions" : [ ],
            "urls" : [ ],
            "text" : "Being a charter member of OSGeo globally basically means that you get to vote on Board members- that's all. Doesn't involve getting out and about other than in a digital sense. Charter member distribution is a good indicator of how much open source geospatial activity is happening in a particular country, and ensures that there's a good balance when voting for board members. Does that help? If the answer is no, that's fine, it's why I'm asking before publicly nominating. But it would be great to have you as a charter member!",
