            "urls" : [ ],
            "text" : "Morning. Thanks so much for all the job leads. I hadn't seen The Planet one. I asked Sara Safavi what they were like a few months ago when another gig came up there. I've now got an offer from a small UK webmapping co. I've audio got applications in with Ordnance Survey and MapAction. I'd love to work for the latter. And I had a good conversation with CARTO yesterday about a deckGL/keplerGL job. That one would be React, and I told him I didn't know frameworks. He didn't seem to mind.",
