            "text" : "Brilliant - thanks very much. No, it's not the same plugin or repo, but it does depend on Vector Tiles Reader. This repo is https://t.co/swYumdHYIM. It uses the API key the user specifies in Vector Tiles Reader, so if the user has not entered their own, it uses the one supplied with that plugin.",
