            "urls" : [ ],
            "text" : "Hi Nathaniel, I'm trying to add vector tile support to qgis2web, using the Vector Tile Reader QGIS plugin. That plugin obviously supplies a default Mapzen API key. Are you OK with my working on this, and using that key for testing? Obviously if it all works, users will put their own key into the Vector Tiles Reader GUI.",
