            "reactions" : [ ],
            "urls" : [ ],
            "text" : "Hi Paul. Hope you are well. Do you know of any local Independent Financial Advisors you'd recommend? We just sold a house we've been letting out for twenty years, so have some money we need to do something with, while keeping it accessible for capital gains tax. Anyone you'd recommend? Thanks in advance. Tom",
