            "reactions" : [ ],
            "urls" : [ ],
            "text" : "He mentioned that training was a bottleneck with Matt W, and that I might take some on. That process they have the need. And surely you could spin yourself as a PM? Though I hear what you say - it's hardly my strong suit either.",
