            "recipientId" : "381118369",
            "reactions" : [ ],
            "urls" : [ ],
            "text" : "So they are recruiting PM because Eoghan's away. I'd definitely talk to Dan. You can take either tack: I can be a PM and also help out with training; or, I know you are losing a PM, but I think I could adds huge value in training.",
