            "urls" : [ ],
            "text" : "Gah, this was so tempting, and I love that they are recruiting for this position but I really do think that I need a project manager rather to be a project manager. Training capacity is definitely something I could provide though, and something I have talked to Dan about in the past. My current gig is up in September so I might talk to him again soon.",
