            "text" : "They need a project manager, if that could be your bag. They need more training capacity, and seem keen for people to find their niche in the company. How go things currently? You sounded pretty happy in work, but I thought it worth mentioning. Dan who recruited me asked outright of I could think of anyone for the project manager vacancy.",
