            "urls" : [ ],
            "text" : "A quick question: in the ne VT renderer, is the syntax for filter the same as MBGLJS JSON styles? I presume not - MBGLJS is in JSON, but I guess QGIS is a QGIS expression? I'll have to convert QGIS &gt; JSON.",
