            "text" : "Hi Tom, hope you’re well. \n\nWe are excited to be launching our GeoDataViz Virtual Gallery soon…it allows people to experience our maps in a new way, at their own pace, like you would in a real art gallery. \n\nWe wanted to share the link with you before we launch: https://t.co/GhvsBzDxe6  (but please don’t share before we do). \n\nAs you walk around you will notice that there are other rooms which are currently closed off…our plan is to open these up allowing others to exhibit their maps/art/digital work. We have also included some audio treats, so make sure your sound is on.\n\nWe would love to know what you think. Cheers.",
