            "recipientId" : "296260201",
            "reactions" : [ ],
            "urls" : [ ],
            "text" : "Hi Tom,\n\nWe've spoken to our technician however he is no longer on site with the crew and has been unable to get in touch.  He is chasing this up now and is going to get back to us.\n\nThanks,\nFaye",
            "mediaUrls" : [ ],
