            "text" : "You were admiring a Fiske map, but thought you'd like a Fisk map. Here are high quality scans rectified of Harold Fisk maps of the Mississippi. Lovely. Fine wrapping paper for map nerd gifts if you have a plotter to print.\nLet me know if you like and download to your system, as I will close the link at end of year. These were generated/published by the US ACE and are available for public use. https://t.co/3D5GhKFjPH",
